pragma solidity ^0.4.17;

import 'zeppelin-solidity/contracts/token/ERC721/ERC721Token.sol';
import 'zeppelin-solidity/contracts/ownership/Ownable.sol';

contract BallerToken is ERC721Token, Ownable {
    string public constant name = "BallerToken";
    string public constant symbol = "BALL";

    struct Baller {
        string name;
        string species;
        uint strength;
        uint speed;
        uint shot;
        uint pass;
        uint confidence;
        uint age;
        uint position;
        uint height;
        uint shift;
    }

    Baller[] public ballers;

    function mint(string _name, string _species, uint _strength, uint _speed, uint _shot, uint _pass, uint _confidence, uint _age, uint _position, uint _height, uint _shift) public payable onlyOwner {
        Baller memory _baller = Baller({ name: _name, species: _species, strength: _strength, speed: _speed, shot: _shot, pass: _pass, confidence: _confidence, age: _age, position: _position, height: _height, shift: _shift });
        uint _ballerId = ballers.push(_baller) - 1;

        _mint(msg.sender, _ballerId);
    }

    function develop(uint _points, uint _assists, uint _rebounds, uint _steals, uint _blocks, uint _turnovers, uint _tokenId, uint _derivative) {
        Baller memory _baller = ballers[_tokenId];

        _baller.strength += (_rebounds + _blocks) * (_derivative + _baller.shift) * 4 / 100;
        _baller.speed += (_assists + _steals) * (_derivative + _baller.shift) * 4 / 100;
        _baller.shot += _points * (_derivative + _baller.shift) * 5 / 100;
        _baller.pass += _assists * (_derivative + _baller.shift) * 4 / 100;
        _baller.confidence += (_points + _rebounds - _turnovers) * (_derivative + _baller.shift) * 8 / 100;
        _baller.age += 1;
        _baller.shift += ((_points - (_baller.shot/3)) + (_assists - (_baller.pass/9)) + (_rebounds - (_baller.strength/6))) / 10;
    }


    function getBaller( uint _ballerId ) public view returns(string, string, uint, uint, uint, uint, uint, uint, uint, uint, uint) {
        Baller memory _baller = ballers[_ballerId];

        return (
            _baller.name,
            _baller.species,
            _baller.strength,
            _baller.speed,
            _baller.shot,
            _baller.pass,
            _baller.confidence,
            _baller.age,
            _baller.position,
            _baller.height,
            _baller.shift
        );
    }
}
